funcReserve:
function funcReserve() {
  log("funcReserve");
  const param = {
    type: "command",
    sub_type: "reserve/reserve",
    device_id: "${deviceId}",
    device_token: "${deviceToken}",
    golf_club_id: "${golfClubId}",
    message: "start reserve/reserve",
    parameter: JSON.stringify({}),
  };
  TZLOG(param, (data) => {
    log(data);
  });
  Date_Click(year, month, date);
}

